import React, { useState } from 'react';
import './Request.css';

const Request = () => {
  const [image, setImage] = useState('');
  const [description, setDescription] = useState('');

  const handleImageChange = (event) => {
    setImage(event.target.value);
  };

  const handleDescriptionChange = (event) => {
    setDescription(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // Code to submit request to backend or store in local storage goes here
    console.log(`Request submitted: image - ${image}, description - ${description}`);
    setImage('');
    setDescription('');
  };

  return (
    <div className="request-container">
      <h1 className="request-title">Request a Car</h1>
      <form onSubmit={handleSubmit} className="request-form">
        <div className="form-group">
          <label htmlFor="car-image" className="form-label">Car Image URL</label>
          <input type="text" id="car-image" value={image} onChange={handleImageChange} className="form-input" required />
        </div>
        <div className="form-group">
          <label htmlFor="car-description" className="form-label">Car Description</label>
          <textarea id="car-description" value={description} onChange={handleDescriptionChange} className="form-input" required />
        </div>
        <button type="submit" className="request-submit-btn">Submit Request</button>
      </form>
    </div>
  );
};

export default Request;
